import pulp as pulp

"""![texto alternativo](https://)![image.png](data:image/png;base64,)"""

model = pulp.LpProblem("Seleccion_de_Proyectos",pulp.LpMaximize)

A = pulp.LpVariable(' A', lowBound=0, cat='Integer')
B = pulp.LpVariable(' B ', lowBound=0, cat='Integer')
C = pulp.LpVariable(' C ', lowBound=0, cat='Integer')
D = pulp.LpVariable(' D ', lowBound=0, cat='Integer')
E = pulp.LpVariable('  E ', lowBound=0, cat='Integer')

model += 20 * A + 40 * B + 20 * C + 15 * D + 30 * E , "Profit"

model += 5 * A + 4 * B + 3 * C + 7 * D + 8 * E <= 25
model += 1 * A + 7 * C + 9 * E  + 4 * G + 6 * H <= 25
model += 8 * A + 10 * C + 2 * E  + 1 * G + 10 * H <= 25

model.solve()
pulp.LpStatus[model.status]

print("A", pulp.value(A))
print("B", pulp.value(B))
print("C", pulp.value(C))
print("D", pulp.value(D))
print("E", pulp.value(E))